695 Singapore[/google-map]</p><p>For the fastest reply, please use the contact form below.</p><p>[contact-form][/contact-form]</p>',1,NULL,'default',0,NULL,'published','2022-07-05 03:08:06','2022-07-05 03:08:06'),(6,'Cookie Policy','<h3>EU Cookie Consent</h3><p>To use this website we are using Cookies and collecting some Data. To be compliant with the EU GDPR we give you to choose if you allow us to use certain Cookies and to collect some Data.</p><h4>Essential Data</h4><p>The Essential Data is needed to run the Site you are visiting technically. You can not deactivate them.</p><p>- Session Cookie: PHP uses a Cookie to identify user sessions. Without this Cookie the Website is not working.</p><p>- XSRF-Token Cookie: Laravel automatically generates a CSRF \"token\" for each active user session managed by the application. This token is used to verify that the authenticated user is the one actually making the requests to the application.</p>',1,NULL,'default',0,NULL,'published','2022-07-05 03:08:06','2022-07-05 03:08:06'),(7,'Blog List layout','<div>[blog-list limit=\"12\"][/blog-list]</div>',1,NULL,'right-sidebar',0,NULL,'published','2022-07-05 03:08:06','2022-07-05 03:08:06'),(8,'Blog Big layout','<div>[blog-big limit=\"12\"][/blog-big]</div>',1,NULL,'default',0,NULL,'published','2022-07-05 03:08:06','2022-07-05 03:08:06'),(9,'Blog Grid layout','<div>[blog-big limit=\"12\"][/blog-big]</div>',1,NULL,'right-sidebar',0,NULL,'published','2022-07-05 03:08:06','2022-07-05 03:08:06');
